  const handleRunCode = async () => {
  setIsRunning(true);
  const token = sessionStorage.getItem("Authtoken");
  setTestResults([]); // Clear previous test results
  setOutput(''); // Clear previous output

  // Validate backend URL
  const backendUrl = process.env.REACT_APP_BACKEND_URL || 'http://localhost:8788/api';
  console.log('Backend URL:', backendUrl);

  if (!token) {
    toast.error("Unauthorized");
    setIsRunning(false);
    return;
  }

  const results = [];
  const testCases = problem.testCases || [];

  for (let i = 0; i < testCases.length; i++) {
    const testCase = testCases[i];

    try {
      const response = await fetch(`${backendUrl}/code/run`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          "Authorization": `Bearer ${token}`,
        },
        body: JSON.stringify({
          code,
          language,
          testCaseInput: testCase.input, // assuming testCase.input exists
        }),
      });

      // Check response status
      if (!response.ok) {
        const errorText = await response.text();
        throw new Error(`HTTP error! status: ${response.status}, message: ${errorText}`);
      }

      const result = await response.json();

      // Check if the output matches the expected output
      const testPassed = result.output.trim() === testCase.expectedOutput.trim();

      const testResult = {
        testCaseNumber: i + 1,
        input: testCase.input,
        expectedOutput: testCase.expectedOutput,
        actualOutput: result.output,
        passed: testPassed
      };

      results.push(testResult);
      setTestResults(prevResults => [...prevResults, testResult]);

      // Show toast notification for each test case
      if (testPassed) {
        toast.success(`Test Case ${i + 1} Passed!`);
      } else {
        toast.error(`Test Case ${i + 1} Failed: Expected '${testCase.expectedOutput}', Got '${result.output}'`);
      }

      // Update output with the last test case's output
      setOutput(result.output);

      // Optional: Small delay between test cases for better UX
      await new Promise(resolve => setTimeout(resolve, 500));
    } catch (error) {
      console.error(`Error on test case ${i + 1}:`, error);

      const testResult = {
        testCaseNumber: i + 1,
        input: testCase.input,
        expectedOutput: testCase.expectedOutput,
        actualOutput: 'Error during execution',
        passed: false,
        error: error.message
      };

      results.push(testResult);
      setTestResults(prevResults => [...prevResults, testResult]);

      // More detailed error toast
      toast.error(`Test Case ${i + 1} Failed: ${error.message}
Backend URL: ${backendUrl}`);
    }
  }
  setIsRunning(false);
};




